import React from 'react';
import '../../node_modules/bootstrap/dist/css/bootstrap.css';

const Form = props => {
    return(
        <div>
            <div className="form">
                    <form >
                        <div className="form-group">
                            <label>Name</label>
                            <input type="text" name="name" className="form-control" />
                            {/* {
                                props.error.name ?
                                    <span className="text-danger">{props.error.name.message}</span>
                                    : ""
                            } */}
                        </div>
                        <div className="form-group">
                            <label>Pet Name:</label>
                            <input type="text" name="name" className="form-control" />
                            {/* {
                                props.error.species ?
                                    <span className="text-danger">{props.error.species.message}</span>
                                    : ""
                            } */}
                        </div>
                        <div className="form-group">
                            <label>Pet Type:</label>
                            <input type="text" name="type" className="form-control" />
                            {/* {
                                props.error.role ?
                                    <span className="text-danger">{props.error.role.message}</span>
                                    : ""
                            } */}
                        </div>
                        <div className="form-group">
                            <label>Pet Description</label>
                            <input type="text" name="description" className="form-control" />
                            {/* {
                                props.error.specialAbility ?
                                    <span className="text-danger">{props.error.specialAbility.message}</span>
                                    : ""
                            } */}
                        </div>
                        <h5 className="mt-4 mb-2">Skills (optional):</h5>
                        <div className="form-group">
                            <label>Skill 1</label>
                            <input type="text" name="skill_one" className="form-control" />
                            {/* {
                                props.error.age ?
                                    <span className="text-danger">{props.error.age.message}</span>
                                    : ""
                            } */}
                        </div>
                        <div className="form-group">
                            <label>Skill 2</label>
                            <input type="text" name="skill_two" className="form-control" />
                            {/* {
                                props.error.age ?
                                    <span className="text-danger">{props.error.age.message}</span>
                                    : ""
                            } */}
                        </div>
                        <div className="form-group">
                            <label>Skill 3</label>
                            <input type="text" name="skill_three" className="form-control" />
                            {/* {
                                props.error.age ?
                                    <span className="text-danger">{props.error.age.message}</span>
                                    : ""
                            } */}
                        </div>

                        <input type="submit" value="Add Pet" className="btn btn-info"/>
                    </form>
                </div>
            </div>
    )
}

export default Form;
